    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Sachuest Point NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Sachuest Point NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, a summary of Refuge
    resources, information about the management direction, and strategies for implementation
    and monitoring. Key planning issues include: threatened and endangered species,
    coastal sandplain communities, wetland restoration, invasive species control, protection
    of biologically significant areas, public use, hunting, environmental education,
    and improved facilities.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
